import React from 'react';

export const Header = () => {
    return (
        <header className='flex items-center px-8 py-2 bg-blue-950'>
            <span className='font-medium text-white'>AizeTech</span>

            <div className='flex items-center'>
                <button className='text-white font-normal'>
                    Sing Out
                </button>
            </div>
        </header>
    )
}
